  6,\n\t\"tags\": [],\n\t\"title\": \"POPs and stable isotopes in bird and forage
  fish tissues - Persistent organic pollutant levels in juvenile salmonids, forage
  fish and their avian predators from Puget Sound and the outer WA coast\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 5,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-03-21T21:19:52.760361\",\n\t\"name\": \"pops-and-stable-isotopes-in-bird-and-forage-fish-tissues-persistent-organic-pollutant-levels-in\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This project is examining contaminant loads
  of fish prey species of a resident marine bird (Rhinoceros Auklet) breeding in inland
  waters (Puget Sound) and in the northern California Current (outer Washington coast).
  It is being conducted by NMFS FTEs, in collaboration with scientists from the State
  of Washington and University of Puget Sound. Contaminant loads of fish prey as well
  as the marine bird predators are being assessed in the context of other upper trophic
  level predators in Puget Sound (Southern resident killer whales; harbor seals; adult
  salmonids). Scientific manuscripts and technical reports will be the main products.
  nnThe target audience includes the Puget Sound Partnership, resource management
  agencies, stakeholders in the Puget Sound area, and marine scientists in general.
  This is an on-going, stand-alone project without a firm deadline.nnPOPs and stable
  isotopes in bird and forage fish tissues.\",\n\t\"license_title\": null,\n\t\"extras\":
